export default (state = [
    {
        username: "Baron Lip",
        profileImage: ".../public/images/Bitmoji_Baron_lr.png",
        matches: [
            player
        ]
    }
], action) => {

    console.log("reducers/MatchesReducer.js")

    switch (action.type) {
        case "ADD_MATCH":
            console.log("You're adding a Match", state, action);

            return [...state, action.match];

        default:
            return state;
    }
}
